---
- name: "[tpch_lineitem]- orderkey -[tpch_orders]"
  expression: "[This].l_orderkey = [Related].o_orderkey"
  cardinality: "M-1"
- name: "[tpch_orders]- custkey -[tpch_customer]"
  expression: "[This].o_custkey = [Related].c_custkey"
  cardinality: "M-1"
- name: "[tpch_customer]- nationkey -[tpch_nation]"
  expression: "[This].c_nationkey = [Related].n_nationkey"
  cardinality: "M-1"
- name: "[tpch_nation]- nationkey -[tpch_region]"
  expression: "[This].n_regionkey = [Related].r_regionkey"
  cardinality: "M-1"
- name: "[tpch_lineitem]- partkeysuppkey -[tpch_partsupp]"
  expression: "[This].l_partkey = [Related].ps_partkey AND [This].l_suppkey = [Related].ps_suppkey"
  cardinality: "M-1"
- name: "[tpch_partsupp]- partkey -[tpch_part]"
  expression: "[This].ps_partkey = [Related].p_partkey"
  cardinality: "M-1"
- name: "[tpch_partsupp]- suppkey -[tpch_supplier]"
  expression: "[This].ps_suppkey = [Related].s_suppkey"
  cardinality: "M-1"
- name: "[tpch_supplier]- nationkey -[tpch_nation]"
  expression: "[This].s_nationkey = [Related].n_nationkey"
  cardinality: "M-1"